import styled from "styled-components";

export const InputContainer = styled.div`
    width: 100%;
    height: 85px;
    background-color: purple;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    
    font-size: 24px;
    font-family: Arial, Helvetica, sans-serif;
    

    input{
        width: 100%;
        height: 75px;
        background-color: purple;
        border: 0;
        
        

        font-size: 24px;
        font-family: 'Roboto';
        padding: 0, 10px;
        color: white;
    }

    input:a
`
